import React from "react";
import { Row, Col, Image, Card } from "react-bootstrap";
import Todolist from "../components/Playground/Todolist/Todolist";
const Playground = () => {
  return (
    <div>
      <Row style={{padding: "5%", background: "background: linear-gradient(90deg, rgba(26,26,27,1) 0%, rgba(46,46,46,1) 50%, rgba(19,19,19,1) 100%)"}}>
        <Col style={{ textAlign: "center" }}>
          <Card style={{width: "25rem"}} bg="light">
            <Todolist />
          </Card>
        </Col>
      </Row>
    </div>
  );
};

export default Playground;
